import React from "react";
import s from "./Dialog.module.css"
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = "/dialog/" + props.id;
    return (
        <NavLink to={path} activeClassName={s.active} className={s.dialog}>
            <p>{props.name}</p>
        </NavLink>
    );
}

const Message = (props) => {
    return <div className={s.dialog}>{props.message}</div>
}

const Dialog = () => {
    let dialogs = [
        {name: 'Igor', id: '1'},
        {name: 'Artem', id: '2'},
        {name: 'Sasha', id: '3'},
        {name: 'Pasha', id: '4'},
        {name: 'Yana', id: '5'}
    ]
    let messages = [
        {message: 'Hello', id: '1'},
        {message: 'How are you?', id: '2'},
        {message: 'You are shit!', id: '3'}
    ]
    let dialogElements = dialogs.map(dialog => <DialogItem name={dialog.name} id={dialog.id}/>);

    let dialogMessages = messages.map(message => <Message message={message.message}/>)
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItem}>
                {dialogElements}
            </div>
            <div className={s.messages}>
                {dialogMessages}
            </div>
        </div>
    );
}
export default Dialog
